import React, {useState, useEffect} from "react"; 
import './App.css';
import Axios from 'axios';

function App() {
  const [username, setUsername] = useState("");
  const [pw, setPW] = useState("");

  const loginFunc = () => {
    alert('called');
    Axios.post('http://localhost:3001/api/insert', {
      username: username, 
      pw: pw
    }).then(()=>{
      alert('success!');
    });

  };

  return (
    <div className="App">  
      <h1> RentMyRide </h1>

      <div className="login">
        <div> Username </div>
        <input 
          type="text" 
          name="user"
          onChange={
            (e) => {setUsername(e.target.value);
          }}
        />

        <div> Password </div>
        <input 
          type="text" 
          name="pw"
          onChange={
            (e) => {setPW(e.target.value);
          }}  
        />

        <div> <button onClick={loginFunc}> Login </button> </div>

      </div>


    </div>
  );
}

export default App;
